import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-signup',
  templateUrl: './signup.component.html',
  styleUrls: ['./signup.component.css']
})
export class SignupComponent {
    constructor(private router: Router){}
    submit(){
      this.router.navigate(['/login'])
    }
    home2(){
      this.router.navigate(['/home'])

      if (!document.forms[0].checkValidity()) {
        // Display an error message or perform any necessary actions
        console.log("Please fill in all the required fields.");
        return false; // Prevent form submission
      }
      return true; // Allow form submission
    }
}
<!DOCTYPE html>
<html>
  <style>
    h2{
      text-align: center;
    }


  </style>
<body>
  <input type="submit" value="HOME" (click)="home2()">
<h2>SIGN UP Page</h2>

<form class="c" onsubmit="return validateForm()">

  <div>
  First name: 
  <br><input type="text" id="fname" name="fname" required><br>

  Last name: <br>
   <input type="text" id="lname" name="lname" required><br>
   Email: <br>
   <input type="text" id="em" name="email" required><br>
   Password: <br>
   <input type="text" id="pw" name="password" required><br><br>
  <input type="submit" value="Submit" (click)="submit()" >
</div>
</form> 
<script>  
  function validateForm() {
    // Check if the form is valid before submission
    if (!document.forms[0].checkValidity()) {
      // Display an error message or perform any necessary actions
      console.log("Please fill in all the required fields.");
      return false; // Prevent form submission
    }
    return true; // Allow form submission
  }
</script>


</body>
</html>
